  url: https://www.gstatic.com/generate_204
  expected-status: 204
  timeout: 2000
  interval: 600
  tolerance: 50
  proxies:
  - PROXY
  filter: _Claude
- name: Gemini
  type: url-test
  url: https://www.gstatic.com/generate_204
  expected-status: 204
  timeout: 2000
  interval: 600
  tolerance: 50
  proxies:
  - PROXY
  filter: _Gemini
